    const onSuccess = (data) => {
        toast.success("called data students success", { autoClose: 1000 });
      };

      const onError = (error) => {
        toast.error(error.message, { autoClose: 2000 });
      };
    useStudentsData()
  return (
    <div>
      <h4>Dynamic Parallel Queries Page</h4>
    </div>
  );
}
